import ExpenseItem from "./ExpenseItem"
function Expense(props) {
    return (
        <div>
            {
                props.items.map(item => {
                    return (
                        <ExpenseItem key={item.id} date={item.date} name={item.name} price={item.price}></ExpenseItem>
                    )
                })
            }
        </div>
    )
}
export default Expense;
